contract Rebound is ReboundSale(3000000, 0x953B34a6FaEB49f77b9382CedC371Bd412fFCEC9, 0xce40B63d2B6C17c57c26DB02ded1fBf70A650523, this), Context, IBEP20, Ownable {
    using SafeMath for uint256;
    using Address for address;


    IUniswapV2Router02 public uniswapV2Router;
    mapping (address => uint256) private _rOwned;
    mapping (address => uint256) private _tOwned;
    mapping (address => mapping (address => uint256)) private _allowances;
    mapping (address => uint) public lastTimeSold;

    mapping (address => bool) private _isExcluded;
    address[] private _excluded;

    address public uniswapV2Pair;
    address payable growthFuel;

    uint256 private constant MAX = ~uint256(0);
    uint256 private _tTotal = 2500000000 * 10**18;
    uint256 private _rTotal = (MAX - (MAX % _tTotal));
    uint256 private _tFeeTotal;

    string private _name = 'Rebound';
    string private _symbol =  'REBOUND';
    uint8 private _decimals = 18;
    uint private DecimalFactor = 10 ** _decimals;

    uint private _tokensAmountToLiquify;
    bool inSwapAndLiquify;
    bool swapInProgress;
    bool public _swapAndLiquifyEnabled;

    uint public burnRate;
    uint public liquidFuelRate;
    uint public totalBurned;

    event SwapAndLiquify(uint256 tokensSwapped,uint256 ethReceived,uint256 tokensIntoLiqudity);

    modifier lockTheSwap {
        inSwapAndLiquify = true;
        _;
        inSwapAndLiquify = false;
    }

    modifier onlyPresaleDistributor() {
        require(address(this) == _msgSender(), "Rebound: Sender not authorized to distribute pre-sale tokens");
        _;
    }

    constructor (address payable _growthFuel)  {
        _rOwned[msg.sender] = _rTotal;
        emit Transfer(address(0), _msgSender(), _tTotal);

        _swapAndLiquifyEnabled = false;
        swapInProgress = false;
        burnRate = 1;
        liquidFuelRate = 8;
        growthFuel = _growthFuel;

        // eth router 0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D
        // viperswap harmony 0xf012702a5f0e54015362cBCA26a26fc90AA832a3
        // pancakeswap BSC 0x05fF2B0DB69458A0750badebc4f9e13aDd608C7F
        // pancakeswap v2 BSC 0x10ED43C718714eb63d5aA57B78B54704E256024E
        // pancakeswap BSC testnet router 0xD99D1c33F9fC3444f8101754aBC46c52416550D1

        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(0x10ED43C718714eb63d5aA57B78B54704E256024E); // bsc router

        uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory()).createPair(address(this), _uniswapV2Router.WETH());
        uniswapV2Router = _uniswapV2Router;

        _tokensAmountToLiquify = 2500000 * DecimalFactor ;
    }

    function presaleDistribute(address _beneficiary, uint256 _amount) public onlyPresaleDistributor() {
        _transfer(owner(), _beneficiary, _amount);
    }

    function setBurnRate(uint amount) public onlyOwner() {
        require (amount <= 3, "Burn rate !> 3%");
        burnRate = amount;
    }

    function setLiquidFuelRate(uint amount) public onlyOwner() {
        require (amount <= 8, "LiquidFuelRate !> 8%");
        liquidFuelRate = amount;
    }

    function setSwapAndLiquifyEnabled(bool enable) public onlyOwner() {
        _swapAndLiquifyEnabled = enable;
    }

    function setTokensAmountToLiquify(uint amount) public onlyOwner() {
        _tokensAmountToLiquify = amount.mul(DecimalFactor);
    }

    function viewTokensAmountToLiquify() public view returns(uint) {
        return _tokensAmountToLiquify;
    }

    function name() public override view returns (string memory) {
        return _name;
    }

    function symbol() public override view returns (string memory) {
        return _symbol;
    }

    function decimals() public override view returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view override returns (uint256) {
        return _tTotal;
    }

    function getOwner() external view override returns (address) {
        return owner();
    }

    function balanceOf(address account) public view override returns (uint256) {
        if (_isExcluded[account]) return _tOwned[account];
        return tokenFromReflection(_rOwned[account]);
    }

    function transfer(address recipient, uint256 amount) public override returns (bool) {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function allowance(address owner, address spender) public view override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount) public override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(sender, _msgSender(), _allowances[sender][_msgSender()].sub(amount, "BEP20: transfer amount exceeds allowance"));
        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue) public virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender].add(addedValue));
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue) public virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender].sub(subtractedValue, "BEP20: decreased allowance below zero"));
        return true;
    }

    function isExcluded(address account) public view returns (bool) {
        return _isExcluded[account];
    }

    function totalFees() public view returns (uint256) {
        return _tFeeTotal;
    }

    function achievementReward(uint256 tAmount) public {
        address sender = _msgSender();
        require(!_isExcluded[sender], "Excluded addresses cannot call this function");
        (uint256 rAmount,,,,) = _getValues(tAmount);
        _rOwned[sender] = _rOwned[sender].sub(rAmount);
        _rTotal = _rTotal.sub(rAmount);
        _tFeeTotal = _tFeeTotal.add(tAmount);
    }

    function reflectionFromToken(uint256 tAmount, bool deductTransferFee) public view returns(uint256) {
        require(tAmount <= _tTotal, "Amount must be less than supply");
        if (!deductTransferFee) {
            (uint256 rAmount,,,,) = _getValues(tAmount);
            return rAmount;
        } else {
            (,uint256 rTransferAmount,,,) = _getValues(tAmount);
            return rTransferAmount;
        }
    }

    function tokenFromReflection(uint256 rAmount) public view returns(uint256) {
        require(rAmount <= _rTotal, "Amount must be less than total reflections");
        uint256 currentRate =  _getRate();
        return rAmount.div(currentRate);
    }

    function excludeAccount(address account) external onlyOwner() {
        require(!_isExcluded[account], "Account is already excluded");
        if(_rOwned[account] > 0) {
            _tOwned[account] = tokenFromReflection(_rOwned[account]);
        }
        _isExcluded[account] = true;
        _excluded.push(account);
    }

    function includeAccount(address account) external onlyOwner() {
        require(_isExcluded[account], "Account is already excluded");
        for (uint256 i = 0; i < _excluded.length; i++) {
            if (_excluded[i] == account) {
                _excluded[i] = _excluded[_excluded.length - 1];
                _tOwned[account] = 0;
                _isExcluded[account] = false;
                _excluded.pop();
                break;
            }
        }
    }

    function _approve(address owner, address spender, uint256 amount) private {
        require(owner != address(0), "BEP20: approve from the zero address");
        require(spender != address(0), "BEP20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _transfer(address sender, address recipient, uint256 amount) private {
        require(sender != address(0), "BEP20: transfer from the zero address");
        require(recipient != address(0), "BEP20: transfer to the zero address");
        require(amount > 0, "Transfer amount must be greater than zero");

        if(!presaleComplete) {
            require(sender == owner(), "Rebound: pre-sale is not yet complete.");
        }

        uint contractTokenBalance = balanceOf(address(this));
        bool overMinTokenBalance = (contractTokenBalance >= _tokensAmountToLiquify);

        if (overMinTokenBalance && !inSwapAndLiquify && msg.sender != uniswapV2Pair && _swapAndLiquifyEnabled) {
            contractTokenBalance = _tokensAmountToLiquify;
            swapInProgress = true;
            swapAndLiquify(contractTokenBalance);
            swapInProgress = false;
        }

        if(swapInProgress){
            _transferStandard(sender, recipient, amount);
        } else {

            bool feeOnTransfer;
            uint feeFactor = 1;

            if(sender == address(this) || sender == owner() ) {
                feeOnTransfer = false;
            } else {
                feeOnTransfer = true;
            }

            if(recipient == address(uniswapV2Pair) || recipient == address(uniswapV2Router) ) {
                if (feeOnTransfer) {
                    uint oneThirdSenderBalance = balanceOf(sender).div(3);
                    require (amount <= oneThirdSenderBalance);
                    uint _lastTimeSold = lastTimeSold[sender];
                    uint _now = block.timestamp;
                    if (_now.sub(_lastTimeSold) < 1 days) {
                        feeFactor = 2;
                    }
                }
            }

            if (feeOnTransfer) {
                uint liquidityAndFuel = amount.div(100).mul(liquidFuelRate).mul(feeFactor);
                (uint tBurnAmount, uint rBurnAmount) = _getBurnAmounts(amount);
                amount = amount.sub(tBurnAmount).sub(liquidityAndFuel);
                _transferToExcluded(sender, address(this), liquidityAndFuel);

                if (_isExcluded[sender] && !_isExcluded[recipient]) {
                    _transferFromExcluded(sender, recipient, amount);
                } else if (!_isExcluded[sender] && _isExcluded[recipient]) {
                    _transferToExcluded(sender, recipient, amount);
                } else if (!_isExcluded[sender] && !_isExcluded[recipient]) {
                    _transferStandard(sender, recipient, amount);
                } else if (_isExcluded[sender] && _isExcluded[recipient]) {
                    _transferBothExcluded(sender, recipient, amount);
                } else {
                    _transferStandard(sender, recipient, amount);
                }
                _burn(sender, tBurnAmount, rBurnAmount);
            } else {
                _transferStandardNoReflection(sender, recipient, amount);
            }
            swapInProgress = false;
        }
    }

    function _getBurnAmounts(uint amount) private view returns(uint, uint) {
        uint _currentRate = _getRate();
        uint tBurnAmount = amount.div(100).mul(burnRate);
        uint rBurnAmount = tBurnAmount.mul(_currentRate);
        return(tBurnAmount, rBurnAmount);
    }

    function _burn(address sender, uint tBurnAmount, uint rBurnAmount) private {
        if (_rOwned[address(sender)] <= rBurnAmount){
            _rOwned[address(sender)] = 0;
        } else {
            _rOwned[address(sender)] -= rBurnAmount;
        }
        _tTotal = _tTotal.sub(tBurnAmount);
        _rTotal = _rTotal.sub(rBurnAmount);
        totalBurned = totalBurned.add(tBurnAmount);

        emit Transfer(sender, address(0), tBurnAmount);
    }


    function burn(uint amount) public returns(bool) {
        require(amount <= balanceOf(msg.sender), "insufficient amount");
        require(amount > 0, "must be greater than 0");

        uint _currentRate = _getRate();
        uint tBurnAmount = amount;
        uint rBurnAmount = tBurnAmount.mul(_currentRate);
        _burn(msg.sender, tBurnAmount, rBurnAmount);

        return true;
    }

    function _transferStandard(address sender, address recipient, uint256 tAmount) private {
        (uint256 rAmount, uint256 rTransferAmount, uint256 rFee, uint256 tTransferAmount, uint256 tFee) = _getValues(tAmount);
        _rOwned[sender] = _rOwned[sender].sub(rAmount);
        _rOwned[recipient] = _rOwned[recipient].add(rTransferAmount);
        _reflectFee(rFee, tFee);
        lastTimeSold[sender] = block.timestamp;
        emit Transfer(sender, recipient, tTransferAmount);
    }


    function _transferToExcluded(address sender, address recipient, uint256 tAmount) private {
        (uint256 rAmount, uint256 rTransferAmount, uint256 rFee, uint256 tTransferAmount, uint256 tFee) = _getValues(tAmount);
        _rOwned[sender] = _rOwned[sender].sub(rAmount);
        _tOwned[recipient] = _tOwned[recipient].add(tTransferAmount);
        _rOwned[recipient] = _rOwned[recipient].add(rTransferAmount);
        _reflectFee(rFee, tFee);
        lastTimeSold[sender] = block.timestamp;
        emit Transfer(sender, recipient, tTransferAmount);
    }

    function _transferFromExcluded(address sender, address recipient, uint256 tAmount) private {
        (uint256 rAmount, uint256 rTransferAmount, uint256 rFee, uint256 tTransferAmount, uint256 tFee) = _getValues(tAmount);
        _tOwned[sender] = _tOwned[sender].sub(tAmount);
        _rOwned[sender] = _rOwned[sender].sub(rAmount);
        _rOwned[recipient] = _rOwned[recipient].add(rTransferAmount);
        _reflectFee(rFee, tFee);
        emit Transfer(sender, recipient, tTransferAmount);
    }

    function _transferBothExcluded(address sender, address recipient, uint256 tAmount) private {
        (uint256 rAmount, uint256 rTransferAmount, uint256 rFee, uint256 tTransferAmount, uint256 tFee) = _getValues(tAmount);
        _tOwned[sender] = _tOwned[sender].sub(tAmount);
        _rOwned[sender] = _rOwned[sender].sub(rAmount);
        _tOwned[recipient] = _tOwned[recipient].add(tTransferAmount);
        _rOwned[recipient] = _rOwned[recipient].add(rTransferAmount);
        _reflectFee(rFee, tFee);
        emit Transfer(sender, recipient, tTransferAmount);
    }

    function _reflectFee(uint256 rFee, uint256 tFee) private {
        _rTotal = _rTotal.sub(rFee);
        _tFeeTotal = _tFeeTotal.add(tFee);
    }

    function _transferToNoReflection(address recipient, uint256 tAmount ) public onlyOwner() {
        (uint rAmount, uint rTransferAmount, uint tTransferAmount) = _getNRValues(tAmount);
        _rOwned[msg.sender] = _rOwned[msg.sender].sub(rAmount);
        _tOwned[recipient] = _tOwned[recipient].add(tTransferAmount);
        _rOwned[recipient] = _rOwned[recipient].add(rTransferAmount);
        emit Transfer(msg.sender, recipient, tTransferAmount);
    }

    function _transferStandardNoReflection(address sender, address recipient, uint256 tAmount) private {
        (uint rAmount, uint rTransferAmount, uint tTransferAmount) = _getNRValues(tAmount);
        _rOwned[sender] = _rOwned[sender].sub(rAmount);
        _tOwned[recipient] = _tOwned[recipient].add(tTransferAmount);
        _rOwned[recipient] = _rOwned[recipient].add(rTransferAmount);
        emit Transfer(sender, recipient, tTransferAmount);
    }


    function _getNRValues(uint256 tAmount) private view returns (uint256, uint256, uint256) {
        (uint tTransferAmount) = _getNRTValues(tAmount);
        uint currentRate =  _getRate();
        (uint rAmount, uint rTransferAmount) = _getNRRValues(tAmount, currentRate);
        return (rAmount, rTransferAmount, tTransferAmount);
    }

    function _getNRTValues(uint256 tAmount) private pure returns (uint256) {
        uint256 tTransferAmount = tAmount;
        return (tTransferAmount);
    }

    function _getNRRValues(uint256 tAmount, uint256 currentRate) private pure returns (uint256, uint256) {
        uint256 rAmount = tAmount.mul(currentRate);
        uint256 rTransferAmount = rAmount;
        return (rAmount, rTransferAmount);
    }

    function _getValues(uint256 tAmount) private view returns (uint256, uint256, uint256, uint256, uint256) {
        (uint256 tTransferAmount, uint256 tFee) = _getTValues(tAmount);
        uint256 currentRate =  _getRate();
        (uint256 rAmount, uint256 rTransferAmount, uint256 rFee) = _getRValues(tAmount, tFee, currentRate);
        return (rAmount, rTransferAmount, rFee, tTransferAmount, tFee);
    }

    function _getTValues(uint256 tAmount) private pure returns (uint256, uint256) {
        uint256 tFee = tAmount.div(100).mul(5);
        uint256 tTransferAmount = tAmount.sub(tFee);
        return (tTransferAmount, tFee);
    }

    function _getRValues(uint256 tAmount, uint256 tFee, uint256 currentRate) private pure returns (uint256, uint256, uint256) {
        uint256 rAmount = tAmount.mul(currentRate);
        uint256 rFee = tFee.mul(currentRate);
        uint256 rTransferAmount = rAmount.sub(rFee);
        return (rAmount, rTransferAmount, rFee);
    }

    function _getRate() private view returns(uint256) {
        (uint256 rSupply, uint256 tSupply) = _getCurrentSupply();
        return rSupply.div(tSupply);
    }

    function _getCurrentSupply() private view returns(uint256, uint256) {
        uint256 rSupply = _rTotal;
        uint256 tSupply = _tTotal;
        for (uint256 i = 0; i < _excluded.length; i++) {
            if (_rOwned[_excluded[i]] > rSupply || _tOwned[_excluded[i]] > tSupply) return (_rTotal, _tTotal);
            rSupply = rSupply.sub(_rOwned[_excluded[i]]);
            tSupply = tSupply.sub(_tOwned[_excluded[i]]);
        }
        if (rSupply < _rTotal.div(_tTotal)) return (_rTotal, _tTotal);
        return (rSupply, tSupply);
    }

    function manualSwapandLiquify() public onlyOwner() {
        uint contractBalance = balanceOf(address(this));
        swapAndLiquify(contractBalance);
    }

    function manualSwapTokensForEth(uint amount) public onlyOwner() {
        swapTokensForEth(amount);
    }

    function manualAddLiquidity(uint256 tokenAmount, uint256 ethAmount) public onlyOwner() {
        addLiquidity(tokenAmount, ethAmount);
    }

    function swapAndLiquify(uint256 contractTokenBalance) private lockTheSwap {
        uint256 nineSixteenths = contractTokenBalance.div(16).mul(9);
        uint256 tokensForPairing = contractTokenBalance.sub(nineSixteenths);

        uint256 initialBalance = address(this).balance;

        swapTokensForEth(nineSixteenths);

        uint256 newBalance = address(this).balance.sub(initialBalance);

        uint ethForLiquidity = newBalance.mul(5).div(7);
        uint forGrowthFuel = newBalance.sub(ethForLiquidity);

        payable(address(growthFuel)).transfer(forGrowthFuel);
        addLiquidity(tokensForPairing, ethForLiquidity);

        emit SwapAndLiquify(nineSixteenths,ethForLiquidity,tokensForPairing);

    }

    function swapTokensForEth(uint256 tokenAmount) private {
        // generate the uniswap pair path of token -> weth
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapV2Router.WETH();

        _approve(address(this), address(uniswapV2Router), tokenAmount);

        // make the swap
        uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(tokenAmount,0,path,address(this),block.timestamp);
    }

    function addLiquidity(uint256 tokenAmount, uint256 ethAmount) private {
        // approve token transfer to cover all possible scenarios
        _approve(address(this), address(uniswapV2Router), tokenAmount);

        // add the liquidity
        uniswapV2Router.addLiquidityETH{value: ethAmount}(address(this),tokenAmount,0,0,address(growthFuel),block.timestamp);
    }

    receive() external payable {
        if(!presaleComplete) {
            buyPresaleTokens();
        }
    }
